import React, { Component } from 'react';

export class Show extends Component {
  render() {
    const { changeFunction } = this.props;
    return (
      <fieldset>
          <label htmlFor="">
            Have you ever got to go their show?
            <input
              id="show"
              name="show"
              type="checkbox"
              value="yes"
              onChange={ changeFunction }
            />
          </label>
        </fieldset>
    );
  }
}

export default Show;
